const Bar=(props)=>{
    return(
        <div style={{borderBottom:'solid'}}> 
        <AppBar position="static" style={colorB}>
            
            
        <Toolbar>
        <IconButton >
                       <ImageIcon />
          </IconButton>
          <Typography   sx={{ flexGrow: 1 }} style={text}>
           App Name
          </Typography>
          <Button style={text1}>{props.username}</Button>
          <IconButton>
                       <PersonIcon />
          </IconButton>
        </Toolbar>
      </AppBar></div>
        
    )
    const text={
        color:"#1f1d1d",
        fontSize:"3vh",
        }
        const text1={
            color:"#1f1d1d",
            fontSize:"2vh",
            }
    const colorB={
        background:"#ffffff", 
    }
}
